import React from "react"

function Ideas(props) {
  return (
    <div>
    <h2>Ideas</h2>
    <h3>Um, I haven't had many ideas lately</h3>
    <p>I wrote a thing <a href="https://medium.com/@j_lloyd/all-52-whiteboards-af6fc482fbc7">all about whiteboard drawings</a> </p>
    </div>
  )
}

export default Ideas;
